    def test_api_CTIDService_CompareFeaturesInvalidParam(self, invalidParam, config_obj, CtidServiceApi):
        """人脸 1:1 比对接口, 输入两个特征, 进行比对"""
        # 提取图片特征
        bizSerialNo = "00112345620180420113286953123211563DD535DDGHH"
        photoData = CtidServiceApi.imageToBase64(os.path.join(config.ctid_image_path, "normal_single_face_01.bmp"))
        resp1 = CtidServiceApi.CTIDService_ExtractFeaturePostApi(bizSerialNo=bizSerialNo, photoData=photoData)
        assert resp1.status_code == 200, "校验失败，http响应码错误"
        assert resp1.resp_json['errCode'] == '000', "校验失败，errcode 错误"
        assert resp1.has_attr("feature"), "校验失败，未返回feature字段"
        feature1 = resp1.resp_json["feature"]
        feature2 = resp1.resp_json["feature"]

        intef = CtidServiceApi.CTIDService_CompareFeaturesPostApi(bizSerialNo=bizSerialNo, feature1=feature1,
                                                                  feature2=feature2, sendRequest=False)
        intef.update_body(invalidParam[0], invalidParam[1])

        resp = intef.request()
        assert resp.status_code == 200
        assert resp.resp_json['errCode'] in ['001', '002','003', '004','027']

